import useSWR from 'swr'

const Profile = ()=> {
  const { data, error } = useSWR('https://miras-backend.herokuapp.com');

  if (error) return <div>failed to load</div>
  if (!data) return <div>loading...</div>
  return(

  <div>
    {data.name}
    {data.about}
  </div>);
}
export default Profile;
